A kockázatos jogosultságok meg vannak jelölve. A megjelöletlen jogosultságok általában nehéz visszaélni, ha a botot valaki rosszindulatú szándékkal eltéríti. A vandalizmus kockázatával járó jogosultságok (<span class="mw-grantriskgroup-vandalism">{{int:grantriskgroup-vandalism}}</span> ) felhasználhatók olyan zavarok okozására, amelyek tisztítása sok erőfeszítést igényel. A biztonsági kockázattal járó jogosultságok (<span class="mw-grantriskgroup-security">{{int:grantriskgroup-security}}</span> ) maradandó károkat okozhatnak (például személyes adatok ellopását). A belső jogosultságokat (<span class="mw-grantriskgroup-internal">{{int:grantriskgroup-internal}}</span>) jellemzően csak a webhely operátora használja. Kérjük, ne kérj kockázatos jogosultságokat, hacsak nincs rájuk valóban szükséged.',
