	'messages:apihelp-main-extended-description' => 'hu:<div class="hlist plainlinks api-main-links">
* [[mw:Special:MyLanguage/API:Main_page|Dokumentáció]]
* [[mw:Special:MyLanguage/API:Etiquette|Etikett és használati útmutatók]]
* [[mw:Special:MyLanguage/API:FAQ|GYIK]]
* [https://lists.wikimedia.org/postorius/lists/mediawiki-api.lists.wikimedia.org/ Levelezőlista]
* [https://lists.wikimedia.org/postorius/lists/mediawiki-api-announce.lists.wikimedia.org/ API-bejelentések]
* [https://phabricator.wikimedia.org/maniphest/query/GebfyV4uCaLd/#R Hibabejelentések és kérések]
</div>
<strong>Állapot:</strong> A MediaWiki API egy érett és stabil interfész, ami aktív támogatásban és fejlesztésben részesül. Bár próbáljuk elkerülni, de néha szükség van visszafelé nem kompatibilis változtatásokra; iratkozz fel a [https://lists.wikimedia.org/hyperkitty/list/mediawiki-api-announce@lists.wikimedia.org/ mediawiki-api-announce levelezőlistára] a frissítések követéséhez.

<strong>Hibás kérések:</strong> Ha az API hibás kérést kap, egy HTTP-fejlécet küld vissza „MediaWiki-API-Error” kulccsal, és a fejléc értéke és a visszaküldött hibakód ugyanarra az értékre lesz állítva. További információért lásd: [[mw:Special:MyLanguage/API:Errors_and_warnings|API: Hibák és figyelmeztetések]].

<p class="mw-apisandbox-link"><strong>Tesztelés:</strong> Az API-kérések könnyebb teszteléséhez használható az [[Special:ApiSandbox|API-homokozó]].</p>',
