	'messages:config-welcome' => 'hu:A MediaWiki egy szabad és nyílt forráskódú, PHP-ban írt wikiszoftvercsomag. A Wikipédia és egyéb Wikimédia-projektek platformjaként szolgál, havonta több százmillió embert kiszolgálva. A MediaWiki több mint 350 nyelvre van lokalizálva, és megbízhatóságának, robusztus funkciógyűjteményének köszönhetően nagy és élő közössége van a Wikimédiától független felhasználókból és fejlesztőkből is.

